import { Link } from "react-router-dom";
import BookDetail from "../components/BookDetail";
import BookItem from "../components/BookItem";
import './Detail.css';

const Detail = (props) => {
    return (
        <div>
            <BookItem item={props} />
            <Link className="btnBack" to="/">Back</Link>
        </div>
    );
};

export default Detail;
